    impacts to the industry as a result of the SRKW listing. Primary data was collected,
    analyzed, and reported. Northwest Regional Office and Protected Species Office staff
    used some study results in an Environmental Assessment completed in 2011. This information
    will also be used to compare future data collections to measure social changes as
